import React, {Component} from 'react';

class Register extends Component {
    constructor(props) {
        super(props);
        this.state = {
            nombre: '',
            apellido: '',
            username: '',
            email: '',
            password: '',
            comuna: '',
            direccion: ''
        }
    }

    onNombreChange = (event) =>{
        this.setState({nombre: event.target.value});
    }

    onApellidoChange = (event) =>{
        this.setState({apellido: event.target.value});
    }

    onUsernameChange = (event) =>{
        this.setState({username: event.target.value});
    }

    onEmailChange = (event) =>{
        this.setState({email: event.target.value});
    }

    onPasswordChange = (event) =>{
        this.setState({password: event.target.value});
    }

    onComunaChange = (event) =>{
        this.setState({comuna: event.target.value});
    }

    onDireccionChange = (event) =>{
        this.setState({direccion: event.target.value});
    }

    onRegisterSubmit = () =>{
        fetch('http://localhost:3002/register', {
            method: 'post',
            headers: {'Content-Type': 'application/json'},
            body: JSON.stringify({
                nombre: this.state.nombre,
                apellido: this.state.apellido,
                username: this.state.username,
                email: this.state.email,
                password: this.state.password,
                comuna: this.state.comuna,
                direccion: this.state.direccion
            })
        })
            .then(response => response.json())
            .then(data =>{
                if(data === 'success!!'){
                    this.props.onRouteChange('home');
                }
            })
    }


    render() {
        return(
            <article className="br2 ba dark-gray b--black-10 mv4 w-100 w-50-m w-25-l mw5 center shadow-5">
                <main className="pa4 black-80">
                    <div className="measure center">
                        <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
                        <legend className="f4 fw6 ph0 mh0">Register New User</legend>
                        <div className="mv3">
                            <label className="db fw6 lh-copy f6" htmlFor="nombre">Nombre</label>
                            <input className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" 
                                onChange={this.onNombreChange}
                                type="text" 
                                name="nombre"  
                                id="nombre" 
                                />
                        </div>
                        <div className="mv3">
                            <label className="db fw6 lh-copy f6" htmlFor="apellido">Apellido</label>
                            <input className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" 
                                onChange={this.onApellidoChange}
                                type="text" 
                                name="apellido"  
                                id="apellido" 
                            />
                        </div>
                        <div className="mv3">
                            <label className="db fw6 lh-copy f6" htmlFor="username">Username</label>
                            <input className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" 
                                 onChange={this.onUsernameChange}
                                type="text" 
                                name="username"  
                                id="username" />
                        </div>
                        <div className="mv3">
                            <label className="db fw6 lh-copy f6" htmlFor="email-address">Email</label>
                            <input className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" 
                                onChange={this.onEmailChange}
                                type="email" 
                                name="email-address" 
                                id="email-address" 
                                />
                        </div>
                        <div className="mv3">
                            <label className="db fw6 lh-copy f6" htmlFor="password">Password</label>
                            <input className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" 
                                onChange={this.onPasswordChange}
                                type="password" 
                                name="password"  
                                id="password" 
                                />
                        </div>
                        <div className="mv3">
                            <label className="db fw6 lh-copy f6" htmlFor="comuna">Comuna</label>
                            <input className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" 
                                onChange={this.onComunaChange}
                                type="text" 
                                name="comuna"  
                                id="comuna" 
                                />
                        </div>
                        <div className="mv3">
                            <label className="db fw6 lh-copy f6" htmlFor="direccion">Direccion</label>
                            <input className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" 
                                onChange={this.onDireccionChange}
                                type="text" 
                                name="direccion"  
                                id="direccion" 
                                />
                        </div>
                        </fieldset>
                        <div className="">
                        <input className="b ph3 pv2 input-reset ba b--black bg-transparent grow pointer f6 dib" 
                            onClick={this.onRegisterSubmit} 
                            type="submit" value="Register" 
                            />
                        </div>
                    </div>
                </main>
            </article>
        )
    }
}

export default Register;
